DROP TABLE IF EXISTS `bi_fis_assets_base_info`;
CREATE TABLE `bi_fis_assets_base_info` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `loan_id` int(11) DEFAULT NULL COMMENT '序号',
  `status` varchar(200) DEFAULT NULL COMMENT '状态',
  `project_name` varchar(200) DEFAULT NULL COMMENT '项目名称',
  `project_type` varchar(200) DEFAULT NULL COMMENT '项目类型',
  `main_loan_name` varchar(200) DEFAULT NULL COMMENT '融资主体',
  `assets_no` varchar(200) DEFAULT NULL COMMENT '资产编号',
  `rate_type` varchar(200) DEFAULT NULL COMMENT '付息方式',
  `danxi_amount` decimal(19,2) DEFAULT NULL COMMENT '担息金额',
  `danxi_days` varchar(200) DEFAULT NULL COMMENT '担息天数及原因',
  `preceding_charge` decimal(19,2) DEFAULT NULL COMMENT '前段费用',
  `cut_interest_rate` decimal(19,2) DEFAULT NULL COMMENT '砍头息利率',
  `cut_interest_amount` decimal(19,2) DEFAULT NULL COMMENT '砍头息',
  `caigu_rate` decimal(19,2) DEFAULT NULL COMMENT '财顾费率',
  `caigu_amount` decimal(19,2) DEFAULT NULL COMMENT '财顾费用',
  `is_cut_interest` varchar(200) DEFAULT NULL COMMENT '砍头息是否扣除',
  `is_caigu_amount` varchar(200) DEFAULT NULL COMMENT '砍头息是否扣除',
  `is_commit_letter` varchar(200) DEFAULT NULL COMMENT '是否开具代偿承诺函',
  `is_co_manage` varchar(200) DEFAULT NULL COMMENT '是否设立共管',
  `month_category` int(11) DEFAULT NULL COMMENT '期限',
  `total_amount` decimal(19,2) DEFAULT NULL COMMENT '总融资规模（元)',
  `total_cost_rate` decimal(19,2) DEFAULT NULL COMMENT '总成本（%）',
  `group_cost_rate` decimal(19,2) DEFAULT NULL COMMENT '成本承担的主体 地产集团',
  `area_cost_rate` decimal(19,2) DEFAULT NULL COMMENT '地区公司',
  `borrower_cost_rate` decimal(19,2) DEFAULT NULL COMMENT '借款人',
  `material_cost_rate` decimal(19,2) DEFAULT NULL COMMENT '材料公司',
  `management_channel` varchar(200) DEFAULT NULL COMMENT '资管通道',
  `begin_date` varchar(200) DEFAULT NULL COMMENT '委贷起始日',
  `end_date` varchar(200) DEFAULT NULL COMMENT '委贷终止日',
  `rate_days` int(11) DEFAULT NULL COMMENT '计息天数',
  `loan_bank_name` varchar(200) DEFAULT NULL COMMENT '放款 开户行',
  `loan_bank_no` varchar(200) DEFAULT NULL COMMENT '账号',
  `repay_bank_name` varchar(200) DEFAULT NULL COMMENT '还款 开户行',
  `repay_bank_no` varchar(200) DEFAULT NULL COMMENT '账号',
  `loan_type` varchar(200) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=361 DEFAULT CHARSET=utf8;

